import React from "react";

export const Navbar = () => {
  return (
    <nav>
      <div className="w-full flex justify-between py-5">
        <p className="cust-font text-3xl">Natasha & Manuel</p>
      </div>
      <div className="nav-list text-black">
        <ul>
          <li>About</li>
          <li>Gallery</li>
          <li>Guestbook</li>
          <li>Livestream</li>
        </ul>
      </div>
    </nav>
  );
};
